import React from 'react';
import styled from 'styled-components';

function ResumeListWrapper() {
	return (
		<ComponentWrapper>
			<div className="resumeitem" role="button">
				<div className="resumelist-additem">
					<div className="resumelist-additem-icon">
						<i className="icon-edit-copy" />
					</div>
					<p>새 이력서 작성</p>
				</div>
			</div>
			<div className="resumeitem" role="button">
				<div className="resumelist-additem-upload">
					<input
						multiple=""
						type="file"
						autoComplete="off"
						style={{ display: 'none' }}
					/>
					<div className="resumelist-additem-upload-icon">
						<i className="icon-upload" />
					</div>
					<p>파일 업로드</p>
				</div>
			</div>
			<div
				className="resumeitem"
				data-attribute-id="resume__click"
				data-resume-key="BgAKCw8GAE4HBA0DBwsKSkU="
				role="button"
			>
				<div className="resumelist-badge">
					<div className="matchup-badge">
						<p>매치업 이력서</p>
					</div>
				</div>
				<div className="resumeitem-title">
					<h3 iswriting="1">이해찬 1</h3>
					<p>2022.07.19</p>
				</div>
				<div className="resumeitem-info">
					<div className="resumeitem-lang" iswriting="1">
						한
					</div>
					<span className="writing" iswriting="1">
						작성 중
					</span>
					<div
						id="resume-BgAKCw8GAE4HBA0DBwsKSkU=-dropdown-container"
						className="resumeitem-menu"
					>
						<button type="button">
							<i className="icon-dots-horizontal-triple" />
						</button>
					</div>
				</div>
			</div>
			<div />
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	display: flex;
	flex-direction: row;
	justify-content: flex-start;
	width: calc(100% + 20px);
	flex-wrap: wrap;

	.resumeitem {
		height: 190px;
		width: calc(25% - 20px);
		margin-bottom: 20px;
		margin-right: 20px;
		position: relative;
		border: 1px solid #dbdbdb;
		background-color: #fff;
	}
	.resumelist-additem {
		height: 100%;
		display: flex;
		flex-direction: column;
		align-items: center;
		justify-content: center;
		p {
			font-size: 16px;
			font-weight: 600;
			letter-spacing: normal;
			text-align: center;
			color: #333;
			margin: 20px 0 0;
		}
	}
	.resumelist-additem-icon {
		background-color: #36f;
		color: #fff;
		cursor: pointer;
		width: 74px;
		height: 74px;
		margin: 0 auto;
		border-radius: 50%;
		display: flex;
		justify-content: center;
		align-items: center;
		font-size: 26px;
	}
	.resumelist-additem-upload-icon {
		cursor: pointer;
		width: 74px;
		height: 74px;
		margin: 0 auto;
		border-radius: 50%;
		display: flex;
		justify-content: center;
		align-items: center;
		font-size: 26px;
		background-color: #e1e2e3;
	}
	.resumelist-additem-upload {
		height: 100%;
		display: flex;
		flex-direction: column;
		align-items: center;
		justify-content: center;
		p {
			font-size: 16px;
			font-weight: 600;
			letter-spacing: normal;
			text-align: center;
			color: #333;
			margin: 20px 0 0;
		}
	}
	.resumelist-badge {
		padding-left: 18px;
		padding-top: 15px;
		display: flex;
		flex-wrap: wrap;
		grid-gap: 5px;
		gap: 5px;
	}
	.matchup-badge {
		height: 24px;
		background-color: #f3f9fe;
		color: #36f;
		font-size: 11px;
		font-weight: 700;
		line-height: 13.2px;
		display: flex;
		justify-content: center;
		align-items: center;
		border-radius: 4px;
		padding: 6px;
	}
	.resumeitem-title {
		padding: 6px 20px;
		font-size: 16px;
		font-weight: 500;
		letter-spacing: normal;
		text-align: left;
		> h3 {
			font-size: 18px;
