			border: none;
			color: #999;
		}
		> p {
			color: #999;
			margin-top: 5px;
		}
	}
	.resumeitem-info {
		position: absolute;
		bottom: 0;
		height: 41px;
		width: 100%;
		display: flex;
		flex-direction: row;
		padding: 0 12px 0 20px;
		align-items: center;
		border-top: 1px solid #e0e0e0;
		> span {
			font-size: 16px;
			font-weight: 600;
			line-height: 20px;
			color: #999;
			letter-spacing: normal;
			text-align: left;
		}
	}

	.resumeitem-lang {
		width: 20px;
		color: #999;
		border: 1px solid #999;
		height: 20px;
		border-radius: 2px;
		text-align: center;
		font-size: 12px;
		line-height: 20px;
		font-weight: 600;
		margin-right: 10px;
	}
	.resumeitem-menu {
		display: flex;
		justify-content: center;
		align-items: center;
		margin-left: auto;
		> button {
			font-size: 24px;
			color: #76797e;
			height: 100%;
			width: 24px;
		}
	}
`;

export default ResumeListWrapper;
